import React from 'react';
import PropTypes from 'prop-types';

// Styling
import { Box, Text } from '../../styles';
import SMenu from './styles';

const Menu = ({ isOpen }) => <SMenu>menu</SMenu>;

Menu.propTypes = {
  isOpen: PropTypes.bool.isRequired,
};

export default Menu;
